  //   // send http request
  
  const [name,setName] = useState("");
  const [email,setEmail] = useState("");
  const [password,setPassword]=useState("");
  const [role,setRole]=useState("");
  
  const handleSubmit = ()=>{
   console.log(name+email+password+role);
  }

  
  return (

    <div className="main">
        <div className="boxsignup" style={{ padding:"150px"}}>
                        <h1>Sign Up</h1>
                        <p></p>
                        <TextField inputProps={{ sx: {width: '300px'} }}  id="outlined-basic" label="Name" variant="outlined" />
                        <p></p>
                        <TextField inputProps={{ sx: {width: '300px'} }}  id="outlined-basic" label="Email" variant="outlined" onChange={(event)=>{
                        setEmail(event.target.value);}}/>
                        <p></p>
                        <TextField inputProps={{ sx: {width: '300px'} }}  id="outlined-basic" label="Password" variant="outlined" onChange={(event)=>{
                        setPassword(event.target.value);}} />
                        <p></p>
                        <FormControl fullWidth>
                            <InputLabel id="demo-simple-select-label">Role</InputLabel>
                            <Select
                                labelId="demo-simple-select-label"
                                id="demo-simple-select"
                                
                                label="Role"
                                onChange={(event)=>{
                                  setRole(event.target.value);}}>
                                  
                                <MenuItem value={"student"}>Student</MenuItem>
                                <MenuItem value={"faculty"}>Faculty</MenuItem>
                                <MenuItem value={"admin"}>Admin</MenuItem>
                            </Select>
                        </FormControl>
                        <p></p>
                        <ThemeProvider theme={theme}>
                        <Button  style={{width: '329px',fontSize:"14px",fontWeight:'600',padding:'12px'}}variant="contained" onSubmit={handleSubmit}>Signup</Button>
                        </ThemeProvider>
            </div>
    </div>
  )
}

export default Signup
